import React from 'react'
import NavBar from './NavBar'
import TablesList from './TablesList'
import Admin from './SuperAdmin/Admin'
function Dashboard(props) {
    const { path } = props;
    
    return (
        <div>
            <NavBar />
            { path === '/dashboard' ?
            <TablesList />
        :
        <Admin/>    
        }
        </div>
    )
}

export default Dashboard
